/* Get table cells and cell values grouped by row. Returns: { table_cells, table_cell_values, table_column_values }
 */
function tableCellsGet(tableRows, tableHeaders) {

    let table_cells = [];
    let table_cell_values = []
    let table_rows = tableRows.table_rows;

    // Dynamically generate column names based on the number of children in the first row if necessary
    //
    if (!tableHeaders || tableHeaders.table_columnnames.length == 0 || !table_column_names) {
        if (tableRows && tableRows?.table_rows?.length > 0) {

            // Access the first row and count its children
            const firstRow = tableRows?.table_rows[0];

            var _row_cells = null;
            if (current_cell_selector?.shadowRoot && table_rows[i]?.shadowRoot != null) {
                _row_cells = table_rows[0]?.shadowRoot.querySelectorAll(current_cell_selector.querySelector);
            } else {
                _row_cells = table_rows[0]?.querySelectorAll(current_cell_selector.querySelector);
            }

            const columnCount = _row_cells.length;

            // Generate default column names like "Column1", "Column2", etc.
            table_column_names = tableColumnNames || Array.from({ length: columnCount }, (_, i) => `Column${i + 1}`);

            // Assign to tableHeaders
            tableHeaders = {
                table_columnnames: table_column_names
            };

        } else {
            console.warn("No valid table rows found to determine column names.");
        }
    }

    // Get the original column names from tableHeaders
    let columnNames = tableHeaders?.table_columnnames || [];

    // Parse the column range or max columns
    let col_limit_indexes = parseRanges(col_ranges, columnNames.length);

    // Initialize table_column_values based on the modified table_columnnames
    let table_column_values = [];

    // Directly modify the original table_columnnames array based on col_limit_indexes
    tableHeaders.table_columnnames = col_limit_indexes.map(index => columnNames[index]);

    table_column_values = tableHeaders.table_columnnames.reduce((acc, colName) => {
        acc[colName] = [];
        return acc;
    }, {});

    if (verbose)
        console.debug("Initialized table_column_values with limited columns: " + JSON.stringify(table_column_values));

    for (let i = 0; i < table_rows.length; i++) {
        let return_item_entry = null;
        let _return_item_entry;

        if (highlight_elements && highlight_rows && table_rows[i]) {
            highlightElement(table_rows[i], TABLE_ROW_HIGHLIGHT_BORDER);
        }

        if (verbose)
            console.debug("Selecting cells in row " + i + " with selector: " + current_cell_selector.querySelector);

        var row_cells = null;
        if (current_cell_selector?.shadowRoot && table_rows[i]?.shadowRoot != null) {
            row_cells = table_rows[i]?.shadowRoot.querySelectorAll(current_cell_selector.querySelector);
        } else {
            row_cells = table_rows[i]?.querySelectorAll(current_cell_selector.querySelector);
        }

        if (!row_cells || row_cells.length === 0) {
            continue; // Skip to the next iteration if row_cells is undefined or empty
        }

        let all_cells = Array.from(row_cells);

        // Apply the column limit indexes to filter the cells
        if (col_limit_indexes?.length > 0)
            row_cells = col_limit_indexes.map(index => all_cells[index]);

        if (row_cells?.length > 0) {
            _return_item_entry = {};
            let row_cell_id = 0;
            _return_item_entry["index"] = i;

            // Convert NodeList to an array to allow sorting
            let row_cells_array = Array.from(row_cells);

            // Function to extract numeric value from style properties
            const getStyleValue = (element, property) => parseFloat(element.style[property]) || 0;

            // Determine sorting based on 'orderBy' using a concise switch
            switch (current_cell_selector?.orderBy) {
                case "Left":
                case "Top":
                    row_cells_array.sort((a, b) => getStyleValue(a, current_cell_selector.orderBy.toLowerCase()) - getStyleValue(b, current_cell_selector.orderBy.toLowerCase()));
                    break;

                case "Right":
                case "Bottom":
                    row_cells_array.sort((a, b) => getStyleValue(b, current_cell_selector.orderBy.toLowerCase()) - getStyleValue(a, current_cell_selector.orderBy.toLowerCase()));
                    break;

                default:
                    // No sorting needed if 'orderBy' is not specified or not recognized
                    break;
            }

            // Iterate over the sorted cells
            row_cells_array.forEach((tableCell, index) => {

                let column_name = tableHeaders?.table_columnnames[row_cell_id++];

                var cell = tableCell;
                if (typeof current_cell_selector?.shadowDomPath === 'object') {
                    var shadow = undefined;
                    current_cell_selector.shadowDomPath.forEach((shadowDomQueryString) => {
                        if (shadow === undefined) {
                            shadow = tableCell.querySelectorAll(shadowDomQueryString)[0];
                        } else {
                            shadow = shadow.shadowRoot.host.querySelectorAll(shadowDomQueryString)[0];
                        }
                    });

                    if (shadow !== undefined) {
                        cell = shadow.querySelectorAll(current_cell_selector.shadowQuerySelector)[0];
                    }
                }

                let cell_value = cell ? cell.innerText : "";
                if (verbose)
                    console.debug("Row " + i + " Cell " + index + " value: " + cell_value);

                if (current_cell_selector.stringReplacements !== undefined) {
                    current_cell_selector.stringReplacements.forEach((stringReplacement) => {
                        cell_value = cell_value.replace(stringReplacement, "");
                    });
                }

                _return_item_entry[column_name] = cell_value;
                if (table_column_values)
                    table_column_values[column_name].push(cell_value);

                if (highlight_elements && highlight_cells && cell) {
                    highlightElement(cell, TABLE_CELL_HIGHLIGHT_BORDER);
                }
            });

            return_item_entry = _return_item_entry;
        }

        if (row_cells?.length > 0)
            table_cells.push(row_cells);

        if (return_item_entry !== null) {
            table_cell_values.push(return_item_entry);
        }
    }

    return { table_cells, table_cell_values, table_column_values, table_column_names };
}

/* Validate parameters
 */
parametersProcess();

